import {width} from "@mui/system";
export const TestRoute = (props) => {
  const location = useLocation();
  const propsData = location.state;
  return (
    <Container sx={{p: 5}}>
      <Box
        sx={{
          bgcolor: "#cfe8fc",
          width: 1,
          height: "100vh",
          boxShadow: 3,
          borderRadius: "10px",
        }}
      />
    </Container>
  );
};
